import React from 'react';
import { Container, Row, Col, ProgressBar } from 'react-bootstrap';

const Skills = () => {
  
  return (
    <Container>
      <h1 className="text-center mt-5">Mis Habilidades</h1>

      {/* Metodologia */}
      <Row className="mt-5 circular-border">
        <Col>
          <h2>Metodologia</h2>
          <p>Agilidad: 80%</p>
          <p>Scrum: 70%</p>
        </Col>
      </Row>

      {/* Framework */}
      <Row className="mt-5 circular-border">
        <Col>
          <h2>Framework</h2>
          <p>React: 90%</p>
          <p>Angular: 75%</p>
        </Col>
      </Row>

      {/* IDE */}
      <Row className="mt-5 circular-border">
        <Col>
          <h2>IDE</h2>
          <p>Visual Studio Code: 95%</p>
          <p>IntelliJ IDEA: 80%</p>
        </Col>
      </Row>
    </Container>
  );
}
const progressBarData = ({ icon, detail }) => {
  return (
    <Col xs={6} sm={6} md={6} lg={6} xl={6} className="mb-3">
      <div className="hobby-item">
        <div className="hobby-icon"><i className={icon}></i></div>
        <div className="hobby-text">{detail}</div>
      </div>
    </Col>
  );
};
export default Skills;
